import React from 'react';
import VideoItem from './VideoItem';
import videosData from './videosData.json'

const VideoList = ({ videosData, onDelete }) => (
  <div className="video-list">
    {videosData.map((video) => (
      <VideoItem
        key={video.id}
        video={video}
        onDelete={onDelete} />
    ))}
  </div>
);

export default VideoList;
